INSERT OR REPLACE INTO song (id,name,artist,album,genre,lang,year,date,publishedAt,link_ytb,mp3,avatar,lyrics) VALUES ('Alvaro Soler - Sofia','sofia','Álvaro Soler','Eterno Agosto','pop','es','2016','2023-07-01','2016-04-15T10:00:04Z','https://www.youtube.com/watch?v=qaZ0oAh4evU','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Faudio%2Fmpeg%2F1688151967410_Alvaro%20Soler.mp3?alt=media&token=8d6bf81f-c226-4fba-9953-ea6c0b6fdf02','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Fimage%2Fjpeg%2F1688151874500_Alvaro%20Soler%20-%20Sofia.jpg?alt=media&token=e677d715-9a09-4a9a-a69b-30d42041acb6','Sueño cuando era pequeño \nSin preocupación en el corazón \nSigo viendo aquel momento \nSe desvaneció, desapareció\nYa no te creo, ya no te deseo, eh oh\nSolo te dejo, solo te deseo, eh oh\nMira, Sofia\nSin tu mirada, sigo\nSin tu mirada, sigo\nDime Sofia, cómo te mira\nDime cómo te mira, dime\nSé que no, sé que no\nSé que solo, sé que ya no soy oy oy oy\nMira, Sofia\nSin tu mirada, sigo\nSin tu mirada, Sofia\nDices que éramos felices\nTodo ya paso, todo ya paso\nSé que te corte las alas\nEl te hizo volar, el te hizo soñar\nYa no te creo, ya no te deseo, eh oh\nSolo te dejo, solo te deseo, eh oh\nMira, Sofia\nSin tu mirada, sigo\nSin tu mirada, sigo\nDime Sofia, cómo te mira\nDime cómo te mira, dime\nSé que no, sé que no\nSé que solo, sé que ya no soy oy oy oy\nMira, Sofia\nSin tu mirada, sigo\nSin tu mirada, Sofia\nY, ¿por qué no me dices la verdad?\nSigo sin tu mirada, Sofia\nEy ey, ey ey\nY, ¿por qué no me dices la verdad?\nMira, Sofia\nSin tu mirada, sigo\nSin tu mirada\nDime Sofia, cómo te mira\nDime cómo te mira\nMira, Sofia\nSin tu mirada, sigo\nSin tu mirada, sigo\nDime Sofia, ómo te mira\nDime cómo te mira, dime\nSé que no, sé que no\nSé que solo, sé que ya no soy oy oy oy\nMira, Sofia\nSin tu mirada, sigo\nSin tu mirada, Sofia\nThe single “El Mismo Sol” by young Spanish vocalist Alvaro Soler was one of the biggest summer hits of 2015. Now Soler is about to follow this impressive success story with his new single “Sofia”, set to support the rerelease of his Eterno Agosto album, which is due out in July and includes newly recorded and previously unreleased material. The song was written and produced in Los Angeles, where Alvaro Soler and his team of producers were working with RedOne (Lady Gaga, Nicole Scherzinger, Jason Derulo Jennifer Lopez, etc.).\nYou can’t help feeling that the whole world will be singing about “Sofia” this summer. The music video, shot in Cuba, is likely to contribute further to the record’s success. Looks like all doors are open for “Sofia”. One thing is clear: this summer once again, it will be impossible to avoid enjoying this young Spanish vocalist and his music.');
