ícil que llore'' por mí en otra cama\nDime quién te va a creer\nLa nena no quiere Cartier\nQuiere buscarme en otra piel\nVive en la disco to'' los fine'' de semana (yeah)\nPa'' ver si me vuelve a ver\nNormal, si te sientes solita y me extrañas\nY se te sale mi nombre\nDifícil que llore'' por mí en otra cama\nDime quién te va a creer\nLa nena no quiere Cartier\nQuiere buscarme en otra piel\nVive en la disco to'' los fine'' de semana\nA ver si me vuelve a ver');
INSERT OR REPLACE INTO song (id,name,artist,album,genre,lang,year,date,publishedAt,link_ytb,mp3,avatar,lyrics) VALUES ('song1692894240965','duro','Chris jedi','ChrisJediVEVO','pop','es','2022','2023-08-24','2022-11-08T17:00:09Z','https://www.youtube.com/watch?v=9LItMH0LS6w','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Faudio%2Fmpeg%2F1692894314322_DURO.mp3?alt=media&token=2ead5b7f-dc62-4ca3-bff4-661582690a6e','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Fimage%2Fjpeg%2F1692894297770_DURO.jpg?alt=media&token=98c1f23b-9d6b-4156-974f-1f836bcd8cf3','Si tu fueras gelatto yo te fumo yo te fumo\nBaby que vamos a hacer? (Tú sabes chulo)\nSolo pienso en ese culo y en el momento\nOportuno baby yo te voy a romper (bien duro)\nTú quieres duro? (Dame duro)\nTú quieres duro? (Dame duro)\nTú quieres duro? (Dame duro papi dame más duro)\nPues te doy duro (dame duro)\nYo te doy duro (dame duro)\nYo te doy duro (dame duro papi dame más duro)\nTu encima de mi bellaqueando\nYo quitándote la ropa bellaco\nTe agarro por’cuello y te cambio\nApretándote las nalgas tu en cuatro\nTú quieres duro? (Dame duro)\nTú quieres duro? (Dame duro)\nTú quieres duro? (Dame duro papi dame más duro)\nPues te doy duro (dame duro)\nYo te doy duro (dame duro)\nYo te doy duro (dame duro papi dame más duro)\nEnrolla y prende un phillie\nDándote cotorra chillin\nEl culo no te cabe en el bikini\nBajé con to los diablos\nEn’martillao haciendo wheelie\nGucci hasta las medias\nGafas negras como biggie\nYo te busco en la doble r tintiá\nY tú me das la mamá de la mamá\nYo te llevo pa singapúr sin el avión despegar\nTe acomodo de lao y suave te lo vo’a entrar\nBebé yo soy un diablo y tu no ere una santa\nTú eres la moña verde que me arrebata\nY se que lo que quieres es chingar cuando llama\nTodas las llamadas entran de madrugada\nSiempre quise estar contigo y nunca se pudo\nMe pitchaste el año entero en 2021\nMe probaste y ya no quieres más ninguno\nY ahora me siento less si no es con ese culo\nTú quieres duro? (Dame duro)\nTú quieres duro? (Dame duro)\nTú quieres duro? (Dame duro papi dame más duro)\nPues te doy duro (dame duro)\nYo te doy duro (dame duro)\nYo te doy duro (dame duro papi dame más duro)\nTú quieres duro?\nTú quieres duro?\nTú quieres duro? (Dame duro, dame papi dame más duro)\nPues te doy duro\nYo te doy duro\nYo te doy duro? (Dame duro, dame papi dame más duro)\nSaco el yate y los jetski y te llevo pa''l agua\nTe tuve unas ganas cabronas to el día en la playa\nVolviendo borracha me lo mamó en la guagua\nTerminamos chingando antes de llegar a casa\nYo siempre te lo quise meter y no se pudo\nY ahora le fronteo a to’ el mundo con ese culo\nYo no quiero saber de ninguna otra mujer\nTú te pones más rica cada año cada mes\nTú me tienes maquinando\nQue algo más entre nosotros esta pasando\nSe supone que na’ ma’ estábamos chingando\nAhora me paso en ti to el día pensando\nYo ando siempre maquinando\nQue algo más entre nosotros esta pasando\nSe supone que na’ ma’ estábamos chingando\nAhora me paso en ti to el día pensando siempre maquinando\nTú quieres duro? (Dame duro)\nTú quieres duro? (Dame duro)\nTú quieres duro? (Dame duro papi dame más duro)\nPues te doy duro (dame duro)\nYo te doy duro (dame duro)\nYo te doy duro (papi dame más duro)\nTu encima de mi bellaqueando\nYo quitándote la ropa bellaco\nTe agarro por’cuello y te cambio\nApretándote las nalgas tu en cuatro\nReal hasta la muerte oíste bebé\nLos intocables, los iluminatti\nMami aquí lo que hay son tiburones\nY tú estás nadando en aguas profundas\n(Dame duro)\n(Dame duro)\n(Dame duro papi dame más duro)\n(Dame duro)\n(Dame duro)\n(Dame duro papi dame más duro)');
