INSERT OR REPLACE INTO song (id,name,artist,album,genre,lang,year,date,publishedAt,link_ytb,mp3,avatar,lyrics) VALUES ('song1692894757127','mayor que usted','Daddy Yankee','NATTI NATASHA ','pop','es','2022','2023-08-24','2022-11-16T00:27:16Z','https://www.youtube.com/watch?v=mBYSHwr-p0g','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Faudio%2Fmpeg%2F1692894794711_Mayor%20Que%20Usted.mp3?alt=media&token=79d36296-6374-4fdc-8e35-1392c2d295e6','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Fimage%2Fjpeg%2F1692894780500_Mayor%20Que%20Usted.jpg?alt=media&token=5c6f1f6b-635f-4aba-b3f5-d581b0e97eea','Anoche, anoche\nAnoche (¡Pina Records!), otra vez yo soñé contigo (¡Presenta!)\nSoñaba que me devorabas (¡Natti Natasha!)\nY la cama era testigo (¡W, Yandel!)\nY no me importa que yo sea mayor que usted (ustedes saben ya)\nQue el DJ ponga reggaetón (¡El máximo lider!)\nY las ganas las matamo'' en la pared (¡Prende!)\nY no me importa que yo sea menor que usted\nQue el DJ ponga reggaetón (come on!)\nY las ganas las matamo'' en la pared\nSi el DJ nos pone duro el dembow (duro), mé-métele con flow (duro)\nTú sabes de todo, dale, pierde el control\nNos llevamos 20 mil pa explotarlos en el mall (tú sabe'' ya)\nUn crossover y de tres, como Chris Paul\nAquí no hay Jon Voight, montante en el ascensor (¡Duro!)\nBaby, dale p''arriba, dale y sacudo el motor\nElla prende el cigarrillo, en la mano el alcohol (¡Siempre!)\nY salte del medio, que ella anda en modo sport (¡Oye!)\nSolo come sushi (¡Duro!), la ropa Gucci\nYo te imagino bailándome en el jacuzzi\n50 envidiosas tratando ni que de competir\nBaby, pero tú las matas y las mandas a dormir\nY no me importa que yo sea mayor que usted\nQue el DJ ponga reggaetón\nY las ganas las matamo'' en la pared (¡Fuego!)\nY no me importa que yo sea menor que usted\nQue el DJ ponga reggaetón\nY las ganas las matamo'' en la pared (¡Natti, tú me dices!)\nPa-pa-pa-papi, yo te llamé con la mente\nTengamo'' una aventura, una propuesta indecente\n¿Qué me hiciste, que me tienes loca? (¡Tú sabes!)\nY mi cama te invoca (¡Duro!)\nLas ganas las matamos en la pared\nHaz lo que tú quiera'' y no le pare''\nY a veces él quiere que lo bese\nAy, es que Natti se crece\nQuítate la ropa\nAunque solo te esté soñando\nSiento que me tocas\nY a mí me toca imaginarlo (¡Dime, Yandel!)\nY no me importa que yo sea mayor que usted\nQue el DJ ponga reggaetón\nY las ganas las matamo'' en la pared (come on!)\nY no me importa que yo sea menor que usted (LEGENDADDY)\nQue el DJ ponga reggaetón (la cabra)\nY las ganas las matamo'' en la pared\n¿Cómo fue?, no quiere un chamaquito que esté en cero (¡Hey!)\nQue siempre esté jodiendo con los celos (¡Hey!)\nMami, atrévete (¡Hey!), loco, muévete (¡Hey!)\nQue ella quiere uno que le enseñe el juego\nPeligroso, vamos pa''ónde quiera, que andas con el tortoso\nSomos casi jevos, casi novios, casi esposos, embuste\nEs un corito sano, bellacoso y me dice: "ven, come y vete"\nBoom sha-ka-la, soy el mejor que le mete\nSiempre me llama porque soy su juguete\nEs que nadie como yo le da, soy el que le quita la soledad\nDice que no le importa la edad-dad-dad\nMe acuerdo de cada detalle\nCómo te tocaba no te había tocao nadie (pensaba que tú eres mía)\nLa noche me sabe (¡Súbele, Yandel!) a maldades (siempre)\nQue cumpla tus fantasías, tú solo dime cuáles (¡Wisin y Yandel!)\nY no me importa que yo sea mayor que usted (esto'' puesto pa ti)\nQue el DJ ponga reggaetón\nY las ganas las matamo'' en la pared (DY!)\nY no me importa que yo sea menor que usted\nQue el DJ ponga reggaetón\nY las ganas las matamo'' en la pared\nEsto lo hacemos para que el mundo entero baile reggaetón\n¿Quiénes son? W, Yandel, Natti Natasha, Daddy Yankee\nDj Luian, Mambo Kingz, Santo Niño\nEn los controles, Raphy Pina, ja-ja-ja\nAgárrate, no te vayas a marear (un junte legendary)\nPapi, yo estoy en mis 20 siempre, ja-ja-ja');
