 oh (eh), eh-ehY la luna fue testigo de (oh-oh)El calor de nuestros cuerpos encontrados, oh, oh (eh-eh-eh, ¡doble!)\nRegálame otra noche como aquella de Miami en el hotelHasta el amanecerEscuchando los clásicos de Doble con YandelComo tú no hay ninguna, mami, yo extraño tu piel\nHoy yo me pierdo por La PerlaDicen de ella que es cara de verlaSencillo, easyDicen de ella que no pue''es tenerla (no)\nEy, ey, voy de punta en blanco con la bataMillonaria con hoodie'' barata''To'' me queda bien con una white tee''Tamo aquí en casa, soy una wifey (¡Yandel!)\n¿Por qué será que contigo me da?Son estas gana'' una enfermedá''Te quedaste en mi piel enredá''Te quedaste en mi mente hospedá''\nSi las gana'' ya están en el topeMírame a la cara, deja que mis labio'' te toquen (mami, la leyenda)Que la noche nos arropeY si comerno'' es un error, que tu cuerpo se equivoque\nConmigo, aquello que hicimo'' no lo olvido (no lo olvido)Tengo la luna como testigoBebé, no miento cuando te digo que yo (eh)\nNo puedo olvidar tus besos mojados (woh-oh-oh-oh)Ni la forma en que tú y yo nos devoramosEsa noche en mi cuarto, oh (eh), eh-ehY la luna fue testigo de (oh-oh)El calor de nuestros cuerpos encontrados, oh, oh (eh-eh-eh)\nWisin y Yandel (woh-oh-oh)RosalíaLa Rosalía (woh-oh-oh)Directamente desde La Base¡Jajajajaja! (oh-oh-oh, oh)Los Legendario'' (oh-oh-oh, oh)Que esta es pa'' "La Última Misión"Luny Tunes (woh-oh-oh)Mmm, mmm (woh-oh-oh)Mmm, je, je, je (woh-oh-oh-oh)');
INSERT OR REPLACE INTO song (id,name,artist,album,genre,lang,year,date,publishedAt,link_ytb,mp3,avatar,lyrics) VALUES ('song1692894921439','truco o trato','o2','o2','pop','es','2023','2023-08-24','2023-07-27T16:00:08Z','https://www.youtube.com/watch?v=KKj4u4mtHWI','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Faudio%2Fmpeg%2F1692894988579_truco%20o%20trato.mp3?alt=media&token=d4cfbcc7-9cff-42bb-8819-cb4b82d7e378','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Fimage%2Fjpeg%2F1692894964739_truco%20o%20trato.jpg?alt=media&token=56ce76bf-17c2-4d93-a501-b31f7571c980','Un chandal Nike y lenceria Valentino\nLe encanta grabar todo lo que hace conmigo\nElla es la envidia del barrio y de los amigos\nSi te dijeran todas las cosas que te escribo\nAquí no hay truco ni trato\nLo que tu tienes es innato\nPelo claro cuerpo mulato\nConmigo rompio el celibato\nHey\nFuertes like Poncio Pilato\nMis ojos de fuego como un conato\nAhora que coman tos de mi plato\nSi hundo el banco te lo rescato\nSi la llamo cae inmediato\nDe mi top tiene el liderato\nLa mas dura lo dicen los datos\nHey hey\nAquí no hay truco ni trato\nLo que tu tienes es innato\nPelo claro cuerpo mulato\nConmigo rompio el celibato\nDime que quieres vamos a la accion\nAqui to real nada de ficcion\n(Yeah)\nTrajo hierbote duro el martillo de Thor\nLo hicimos en la cama y en el sillon\nNacio en arucas me sabe a ron\nCapitan Kidd no garrafon\nSi me la como eso es un colocon\nColon conquistando el planeta\nCada vez que en sus muslos me aprieta\nElla conmigo se siente completa\nUna musa pa un loco poeta\nYo romeo y tu mi julieta\nSe conoce todas mis facetas\nSomos claros, no usamos careta\n(Hey)\nAquí no hay truco ni trato\nLo que tu tienes es innato\nPelo claro cuerpo mulato\nConmigo rompio el celibato\nHey\nTocan la puerta las vecinas\nPor la forma en la que gemias\nEn tu cama o en la cocina\nLo que importa es que disfrutes tu postura preferida');
INSERT OR REPLACE INTO song (id,name,artist,album,genre,lang,year,date,publishedAt,link_ytb,mp3,avatar,lyrics) VALUES ('song1692895009985','La Llevo Al Cielo','Chris jedi','ChrisJediVEVO','pop','es','2022','2023-08-24','2022-05-20T00:00:03Z','https://www.youtube.com/watch?v=GEy_XBp-hLo','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Faudio%2Fmpeg%2F1692895045150_La%20Llevo%20Al%20Cielo.mp3?alt=media&token=23c29181-ed0b-4f36-a2fa-4bed511b486c','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Fimage%2Fjpeg%2F1692895030508_La%20Llevo%20Al%20Cielo.jpg?alt=media&token=5442c98a-0072-41ad-9891-68b26de3e718','(Chencho)\nYo siempre la llevo al cielo,\nConmigo quema ella cada rato,\nSe crece y coge vuelo\nporque yo no la celo.\nY cuando estamos en el cuarto,\nno tengo que decirle,\nsolita rompe el hielo.\n(Anuel)\nSabe dónde poner sus manos,\nYo con mi punto Débil\npor eso no la dejo\ndesde hace tiempo frente\nal espejo Yooooooo\n(Chencho)\nLe doy lo que le hace falta,\nDice que la obligo a hacer lo que no debe,\nEntre paredes nadie sabe lo que pasa,\nDespués del primer beso nada la detiene,\nSoy la razón por la que ella pierde la calma.\nNo se conforma una noche no es suficiente.\nAl despedirnos no deja que yo me vaya.\nDice que conmigo se siente diferente.\nMe daña la mente que lo diga así.\n(Anuel)\nLa que no chiche…\nQuédate en tu casa.\nBebe y se pone cuatro letras como NASA. (Uy)\nChingando sin condones,\nlas Plan B nunca fracasan. (Brrr)\nMe lo mama a dos manos\ny hasta lo abraza.\nElla es una hija e’ puta como Tokio.\nDespués que se lo meto,\nla mando pa donde el novio.\nY le preguntan que si chingo rico,\ny dice obvio.\nUn polvo no es un polvo\nsi no jode el matrimonio.\nY le gusta chingar arrebata,\nperriando sucio tu eres es senda bellaca. (Llaca)\nÑengo lo dijo que chocha con bicho y bicho con nalga,\ny si eres chumba pues mueve la espalda .\nMami yo no disimulo, (tra) que Dios bendiga ese culo. (Ay papi)\nTe lambo toa’ y te enchulo… (ahhh)\nSe va a venir y grita…(Bien duro)\n(Ñengo)\nYo siempre la llevo al cielo.\nConmigo quema ella a cada rato.\nSe crece y coge vuelo\nporque yo no la celo.\nY cuando estamos en el cuarto,\nno tengo que decirle,\nsolita rompe el hielo.\nSabe dónde poner sus manos\nYo con mi punto Débil\nPor eso no la dejo\nDesde hace tiempo frente\nAl espejo Yoooooooo\n(Chencho)\nLe doy lo que le hace falta\nDice que la obligo a hacer lo que no debe\nEntre paredes nadie sabe lo que pasa,\ndespués del primer beso nadie la detiene.\nSoy la razón por la que ella pierde la calma.\nNo se conforma una noche no es suficiente.\nAl despedirnos no deja que yo me vaya.\nDice que conmigo se siente diferente.\nMe daña la mente que lo diga así.\n(Ñengo)\nSolo tuyo.\nViajando por las nubes,\nya el cielo se cayó.\nDame tu cuerpecito,\nya la bomba estalló.\nTú sabes que yo estoy pa ti.\nTe voy a hacer cosas diferentes\ny no te olvidaras de mi.\nContigo a las alturas mami elévame\nSi sabes lo que haces pues enamórame\nYo se que tu cuerpo ya esta pidiendo sexo\nFuego y beso?\nLo de lo tuyo y mío eso es un desafío.\nA Veces maquino solo y cuando me acuerdo me rio\nLas veces que a tu casa le he llegao’\nAmaneció’ y he brincao’ los portones por el monte\nY en tu cama te he partió .\nToma que esté blunt esta encendio’\nMami ponte ready.\nHijo e’ puta como yo no te ha comio’.\nEl perfume que regaste por tu cuello,\nSe enredo por tu cabello\ny tengo ganas de lamberte como un sello.\n(Chencho)\nCuando la tengo me dice hálame el pelo\nGrita que rico me la como mil veces\nNos devoramos sin decir amor te quiero\nPero sabemos que las ganas crecen y crecen\nCuando la tengo me dice hálame el pelo\nGrita que rico me la como mil veces\nNos devoramos sin decir amor te quiero\nPero sabemos que las ganas crecen y crecen\n(Anuel)\nYo siempre la llevo al cielo\nConmigo ella quema a cada rato\nSe crece y coge vuelo\nPorque yo no la celo\nY cuando estamos en el cuarto\nNo tengo que decirle\nSolita rompe el hielo\nSabe dónde poner sus manos.\nYo con mi punto G\ny por eso no la dejo\ndesde hace tiempo frente\nal espejo Yooooo\n(Chencho)\nLe doy lo que le hace falta…\n(Inintelegible) FXs\n….Dice que la obligo a hacer lo que no debe\nEntre paredes nadie sabe lo que pasa\nDespués del primer beso nada la detiene…\n…Cielo…..');
