go\nDid you miss me?\nWho''s the king? (Dada)\nEh\nEscucha las palabras\nArráncame todo\nQuiero ser de ti\nNo quiero sus huellas\nPrefiero morir\nArráncame todo\nQuiero ser de ti\nNo quiero sus huellas');
