INSERT OR REPLACE INTO song (id,name,artist,album,genre,lang,year,date,publishedAt,link_ytb,mp3,avatar,lyrics) VALUES ('song1692933851843','qué más pues?','J Balvin','jbalvinVEVO','pop','es','2021','2023-08-25','2021-05-28T00:00:26Z','https://www.youtube.com/watch?v=zisuhZqTeH4','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Faudio%2Fmpeg%2F1692933910290_Qu%C3%A9%20M%C3%A1s%20Pues.mp3?alt=media&token=67555b9c-f25b-4319-9dc7-7b2755e90e43','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Fimage%2Fjpeg%2F1692933894809_Qu%C3%A9%20M%C3%A1s%20Pues.jpg?alt=media&token=985b4491-3d6f-4cad-998b-a3d7bf22c1f8','[J Balvin]\n¿Qué mas pues? ¿Cómo te ha ido?\n¿Sigues soltera o ya tienes marido?\nSé que es personal,\nPerdona lo atrevido,\nTe pedí de navidad y Santa no te ha traído,\nPero ¿Qué más pues?\n¿Qué ha habido?\nTe perdi el rastro por distraído,\nLa fama de esto me tiene jodido,\nPero no me olvido de lo sucedido,\nRegálame otra noche, quiero verte,\nQue hay que aclarar par de cosas pendientes,\nMa’, qué es lo que es,\n¿Dónde estás? Dime a ver,\nQue yo voy…(voy)\n[Maria Becerra]\nLady Lady,\nMe perdiste de vista,\nAhora es con otro con quien vacilo en la pista,\nAy Jose no me insistas,\nDas muchas vueltas pareces motociclista,\nNinguna con este porte,\nTengo este booty sin hacer deporte,\nNada hace que me importe,\nPorque mi brújula ya cambió su norte,\nCambió desde que te fuiste tú,\nPapi eso lo sabes muy bien,\nNo me vengas con esa actitud,\nQue esa la conozco yo también,\nNo, no,&nbsp;\nNo, soltera para tí, no, (hey…)\nYo soltera para tí no,\nSe acabó lo que esa noche nos dimos, (hey..)&nbsp;\nLo que esa noche nos dimos,\nPa’ ¿Qué es lo que es?\nSé que quieres saber,\nDónde estoy&nbsp; (Dónde estoy…)\n[J Balvin]\nDime Mai’ ¿Qué es la que hay?\nEsos Nike, te quedan nice,\nDe tu clase ya pocas hay,\nNinguna cabe en tu size,\nSaca un rato,&nbsp;\nQue estas sola, ya me dieron el dato,\nDame el pin, yo te caigo de inmediato,\nEllos intentan y yo ni trato,\nBaby esto ya es otra liga,\nPero tú estás por encima,\nVamos a hacerlo,\nAprovecha el clima,\nTú estás bien diva,\nY ese cuerpo que motiva,\nBaby, vamos a hacerlo,\nQue está rico el clima,\n[Maria Becerra]\n¿Qué más pues? ¿Cómo te ha ido?\nTú sigues siendo el mismo engreído,\nNada personal,\nPa’ novio no has nacido,\nY tuviste mucho tiempo,\nFuiste distraído,\nY ahora ¿Qué más pues?\nMe he ido,\nYa es suficiente lo que tú has comido,\nAunque no aparezcas, esto me ha dolido,\nY de lo pasado yo no me olvido,\n[J Balvin]\nRegálame otra noche, quiero verte,\nQue hay que aclarar par de cosas pendientes,\nMa’ ¿Qué es lo que es?\n¿Dónde estás? Dime a ver,\nQue yo voy (voy…)\n[Juntos]\nRegálame otra noche, quiero verte,\nQue hay que aclarar par de cosas pendientes,\nMa’ ¿Qué es lo que es?\n¿Dónde estás? Dime a ver, (Dónde estoy….)\nQue yo voy (voy…)');
INSERT OR REPLACE INTO song (id,name,artist,album,genre,lang,year,date,publishedAt,link_ytb,mp3,avatar,lyrics) VALUES ('song1692933967789','am remix','Nio Garcia','Flow La Movie','pop','es','2021','2023-08-25','2021-06-25T00:00:09Z','https://www.youtube.com/watch?v=RNzQdcPWWX4','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Faudio%2Fmpeg%2F1692934002556_AM%20Remix.mp3?alt=media&token=c2aa0f86-31b8-486f-a1b7-94a4fbf5a554','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Fimage%2Fjpeg%2F1692933989283_AM%20Remix.jpg?alt=media&token=037cb489-f01f-4c7e-8c27-6f2870e9096b','[J Balvin]\nLatino Gang Gang\nNio\nAM Remix\nLet'' Go\n[Intro: J Balvin &amp; Bad Bunny]\nTú eres la número uno (1)\nComo tú, no hay dos (2)\nCon la cama somos tres (3)\n¿Por qué no nos comemos?\nEstoy loco de ponerte en cuatro (4)\nPero a ti sin cojones (5)\nAunque nos queremos\nMe llamas a las seis (6), pa'' fumar te traje haze\nSon siete (7) los pecados que te quiero cometer\nChingamos en la V8, ni llegamos al motel\nComenzamos a las nueve (9) y terminamos a las diez (10)\n[Coro: Nio García &amp; Bad Bunny]\nAM cuando la toco ella de na'' se viene\nEstoy pa'' darte lo que tú me ordenes\nSolo me buscas cuando te conviene\nAM cuando la toco ella de na'' se viene\nEstoy pa'' darte lo que tú me ordenes\nSolo me buscas cuando te conviene\n[Verso: J Balvin]\nCuando te conviene viene''\nNo va al gym pa'' que conmigo entrene''\nNunca falta un polvo en los "wikenes"\nLa baby, bien loco me tiene\nYa comí pero quiere que me la cene\nA la una (1) los dos (2) bajamos el estrés (3)\nCuando la puse en cuatro (4) fue que la enamoré\nA las cinco (5) terminamos y la dejé a las seis (6)\nSi he tenido (7) ganas de volverla a ver\n[Gancho: J Balvin (x2)]\nLa recojo en la V8 a eso de las nueve (9)\na ella le doy un diez (10) por lo rico que se mueve\nEstá haciendo calor pero eso abajo le llueve\nQuiere, que pa'' mi cama me la lleve\n[Coro 2: J Balvin &amp; Nio García]\nAM cuando la toco ella de na'' se viene\nEstoy pa'' darte lo que tú me ordenes\nSolo me buscas cuando te conviene\nAM cuando la toco ella de na'' se viene\nEstoy pa'' darte lo que tú me ordenes\nSolo me buscas cuando te conviene\n[Verso: Bad Bunny]\nBaby, pon la alarma que por tí madrugo\nSi tienes trabajo de la uni, yo te ayudo\nTraté de picharte pero no se pudo\nTu novio es fan, si quieres le envío un saludo\nPa que no se que-je-e\nTranquila, no lo de-je-e\nDile que tu y yo somos amigos y quiero que me aconsejes\nEse culo es artista, me avisas si quieres que lo maneje''\nQue pa'' ti trabajo de 8 a 5, al mínimo\nCuando tú lo mueves, mami, eso es lo máximo\nMe mira'' y tú sabe'' que me pongo tímido\nPrendemo'' y eso se me quita rápido\nPichea a to'' y vámono'' pa'' Mykonos\nQue ayer soñé que en el avión lo hacíamo''\nPide lo que sea, baby, a ti no te digo que no\nSalimo'' de noche y llegamo''\n[Coro 3: Bad Bunny]\nAM cuando la toco ella de na'' se viene\nEstoy pa'' darte lo que tú me ordene''\nSe trepa y dice que yo soy su nene\n[Verso: Nio Garcia &amp; J Balvin]\nY ya tú me conoces, a 300 por la Monse\nMe das la verde y llego antes de las once (11)\nSalimos ''e Carolina, terminamos por Ponce\nSi tú me quieres ver, ¿por qué me picheas, entonces?\nDéjate ver, pa'' terminar lo que no hicimo'' ayer\nEl tiempo es corto y no lo vo''a perder\nYo quiero volver a probar tu piel antes que sean las doce (12)\n[Coro 4: Nio García &amp; Bad Bunny]\nAM cuando la toco ella de na'' se viene\nEstoy pa'' darte lo que tú me ordenes\nSolo me buscas cuando te conviene\nAM cuando la toco ella de na'' se viene\nEstoy pa'' darte lo que tú me ordene''\nSolo me busca'' cuando te conviene\n[Pautas: Nio García &amp; J Balvin]\nJ Balvin Men\nNio\nFlow La Movie\nOK\nGoldi\nTiempo Al Tiempo\nBad Bunny, babe\nXound\nNio García\nBad Bunny, babe\nJ Balvin Men\nLatino Gang Gang, yeah\nNio\nJ Balvin\nYama\nFlow La Movie, yeh');
