uerte de frente y de frente me le paré\n¿Que yo arrepentirme ''e qué?, decía, yo nunca me olvido\nHasta que empecé a escuchar voce'' en mi almohada semidormido\nDistinguí de las buenas, de las malas entre los ruido''\nEntre la espada y la pared, entre el micrófono y los tiro''\nEl que de chamaquito le tenía odio a Dios\nPorque la mayoría de mi familia se la llevo\nEntendí que por la puerta del cielo entraron\nY volví a recuperar la fe que se me perdió\nEn mi barrio el intocable pa'' los ojos de los mío''\nMe miraban con admiración\nY otros se llenaron de envidia\nMi progreso fue mi maldición\nOrando a Dios y que conteste mis murmullo''\nDime si cuando me muera estaré entre los tuyo''\nSabrán mis hijos las cosas que hice mal\nY temo a a que crezca mañana y no me vean con orgullo\nPor encima de nosotro'' jamás pasa nadie\nMe pregunto qué tan orgulloso estaría mi padre\nQue en paz descanse mi madre, me hicieron ser imparable\nSiempre he sido un guerrillero que por mí la calle hable\nBaby Rasta');
