 ''jo''eputa"\nReal hasta la muerte, brr\nBaby, me gustaría\nComerte el día completo\nTo'' lo que yo te haría\nSi el reloj nos diera más tiempo (uah)\nBaby, e'' que tú ere'' mía, lo que te haría, eh-eh (uah)\nSi el reloj nos diera más tiempo (ey, Ra-Rauw)\nNo hizo nada mal, pero quiere que la castigue\nGime como una muñequita de anime (wah)\nComo una serie pegá'', viendo me sigue (wuh)\nY yo loco con verla mordiendo lo'' cojine''\nBaby, tú me mata'', e'' que te pasas\nCon esa foto, sierva, tú está'' a fogata (wuh-uh)\nTe espero en casa, te vo''a dar de lo que te arrebata (wuh)\nCuando te vuelva a ver, te voy a amarrar en la cama (ey)\nMi lengua por tu piel, me gusta tenerte de espalda (mami)\nTú no puede'' mentirme, yo sé que a mi tú me ama''\nTú me debe'' algo y lo sabe''\nNo dejemos que esta noche se acabe\nQue nadie sabe (yah)\nBaby, me gustaría\nComerte el día completo\nTo'' lo que yo te haría\nSi el reloj nos diera más tiempo (uah)\nBaby, e'' que tú ere'' mía, lo que te haría, eh-eh (uah)\nSi el reloj nos diera más tiempo\nBaby, e'' que tú ere'' mía, lo que te haría, eh-eh\nSi el reloj nos diera más tiempo (brr)\nEy, Ra-Rauw, ey\nReal hasta la muerte, baby\nRauw Alejandro\nReal hasta la muerte, baby\nCon Anuel\nRa-Rauw\nLo'' intocable'', ¿oí''te, bebé?\nNesty\nLo'' illuminati\nCaleb Calloway\nBrr\nDuars Entertainment con Los Sensei\nOh-yeah-yeah');
INSERT OR REPLACE INTO song (id,name,artist,album,genre,lang,year,date,publishedAt,link_ytb,mp3,avatar,lyrics) VALUES ('song1707146253042','bandido','myke towers','Myke Towers','pop','es','2020','2024-02-05','2020-12-10T23:01:22Z','https://www.youtube.com/watch?v=W6fme7tcweQ','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Faudio%2Fmpeg%2F1707146336381_bandido.mp3?alt=media&token=0f755425-38df-436a-85d4-e4690aad70e7','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Fimage%2Fjpeg%2F1707146331210_bandido.jpg?alt=media&token=8f6c4cf7-6e6b-4dff-9933-a80644bb02d7','Ella es buena, pero le gustan los malo''\nSi te soy sincero, yo por ella jalo\nMe tiró diciéndome que la dejaron\nEs otra más que con su corazón jugaron\n¿Ese bandido qué le hizo? Dígame por qué llora\nConfiéseme pa'' darle piso y enterrarlo ahora\nQue yo la puedo defender a usted si me colabora\nLe voy a dejar saber a ese man que ya no está'' sola\n¿Ese bandido qué le hizo? Dígame por qué llora\nConfiéseme pa'' darle piso y enterrarlo ahora\nQue yo la puedo defender a usted si me colabora\nLe voy a dejar saber a ese man que ya no está'' sola\nMi amor, avísame si acaso te incomoda\nPa'' reventarlo y que sepa que no estás sola\nYo te hablo claro, yo no brego con pistola''\nPero tengo el respeto de los que controlan\nTú eres hermosa, mami, dime por qué lloras, te haría mi señora\nElla le da lo mismo en un crucero que una yola\nCondones de colores, la parto a los crayola\nMujeres como tú, uno las desea y las añora\nDiles que tú tienes vaqueo, si pones el booty en reversa\nYo le prendo la cámara como cuando parqueo\nLe gusta el maleanteo, dice que la están buscando\nPorque mata la liga, yo se lo creo\n¿Ese bandido qué le hizo? Dígame por qué llora\n(Baby, por qué lloras?)\nConfiéseme pa'' darle piso y enterrarlo ahora\n(Pa'' meterle ahora)\nQue yo la puedo defender a usted si me colabora\n(Si tú me colabora'')\nLe voy a dejar saber a ese man que ya no está'' sola\n(Me dicen Juhn El All Star, baby)\nY ese bandido, ¿qué fue lo que hizo?\nConfiesa pa'' de una darle piso\nYa no te quiero ver llorando, ese no vuelve a hacerte daño\nBebecita, te lo garantizo\nEs que lo de ella y lo mío es un romance secreto\nCalla''o, bien en discreto, la beso y la aprieto\nMe la llevo por el mundo y gasto el ticket completo\n(Por ella, reviento a cualquier sujeto)\nA ella le gusta lo malo, lo bueno, lo caro\nTiterona, no se asusta si escucha un disparo\nEl cuerpo es hermoso, los ojos son claro''\nEra mi reina, ahora es mi diosa, a ella ni la comparo\nQué pereza\nVerla triste con tanta belleza\nQuien dañó un corazón con mucha pureza\nNo sabe tratar con delicadeza\nPrincesa, a él no le interesa\nSi yo soy el que te toca y te besa\nCuando la vi, yo dije: Quiero con esa\nDesde esa vez no sales de mi cabeza\n¿Ese bandido qué le hizo? Dígame por qué llora\n(Baby, por qué lloras?)\nConfiéseme pa'' darle piso y enterrarlo ahora\n(Pa'' meterle ahora)\nQue yo la puedo defender a usted si me colabora\n(Si tú me colabora'')\nLe voy a dejar saber a ese man que ya no está'' sola\n¿Ese bandido qué le hizo? (Ay)\n¿Qué le hizo? (Me dicen Juhn, El All Star, baby)\nEste es Juhn\nMyke Towers, baby\nEl All Star\nJuhn, El All Star\nMyke Towers\nSantana The Golden Boy\nEsto es una combinación única en su clase, baby\n(¿Ese bandido qué le hizo?)\nLas estrellas siempre andan juntas (¿qué le hizo?)\nLa Casa Blanca en sociedad con los de Oro\nOne World');
