ro contigo siempre vuelvo a caer\nEntre un "Te quiero" y un "Nunca más"\nEntre la espada y la pared cuando no estás (no estás)\nY la razón, la razón yo no la conozco\nPero contigo siempre vuelvo a perder\nMás de lo que aposté (oh-oh-oh, oh)\nPero contigo siempre vuelvo a perder\nMás de lo que aposté (oh-oh-oh, oh)\nMás de lo que aposté\nTú me vas cambiando las señales\nRompes mis planes y así no vale (mmm)\nYo estaba esperando algo distinto\n¿Será mi instinto el que me falló?\nA veces somos, a veces no (¡No!)\nUn día es odio (un día es odio)\nOtro es amor (otro es amor)\nY la razón, la razón yo no la conozco\nPero contigo siempre vuelvo a caer (no)\nEntre un "Te quiero" ("Te quiero")\nY un "Nunca más" (ah-ah)\nEntre la espada y la pared cuando no estás\nY la razón, la razón yo no la conozco\nPero contigo siempre vuelvo a perder\nMás de lo que aposté (no-oh, oh-oh-oh, oh)\nPero contigo siempre vuelvo a perder\nMás de lo que aposté (oh-oh-oh, oh)\nMás de lo que aposté');
INSERT OR REPLACE INTO song (id,name,artist,album,genre,lang,year,date,publishedAt,link_ytb,mp3,avatar,lyrics) VALUES ('song1707146805391','la curiosidad','Jay Wheeler','Jay Wheeler','pop','es','2020','2024-02-05','2020-07-17T16:01:00Z','https://www.youtube.com/watch?v=Q_gIYp078so','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Faudio%2Fmpeg%2F1707146896000_la%20curiosidad.mp3?alt=media&token=cc7cca69-fa72-4ba4-8f76-7e338cd68838','https://firebasestorage.googleapis.com/v0/b/carrotstore.appspot.com/o/song%2Fimage%2Fjpeg%2F1707146891228_la%20curiosidad.jpg?alt=media&token=6902e098-8923-469e-9813-f5a96eece939','Háblame de ti, ¿cómo tú estás? Quisiera verte\nEn una foto te vi y me dieron ganas de comerte\nSé que al igual que yo, en el amor no has tenido suerte\nPero me matan las ganas de verte\nLa curiosidad me mata y no aguanto\nYa te quiero tener, sólo dime cuándo\nEs que tú y yo muy bien sabemos\nQue es diferente cuando nos comemos (yeah)\nEy, yo\nElla es curiosa, una nena estudiosa (yeah)\nA la'' otra'' ella las tiene furiosa''\nLa bañera a ella la pone espumosa\nYo le juego y se la dejo jugosa\nPosa, yo la retrato y le pongo las esposa''\nMarihuana de flore'', ella no quiere rosa''\nSi no se lo hago en la cabaña, en la carroza\nTe ves hermosa\nA mí me dio con verte pero de frente\nYo sé que ere'' diferente, ya chequeé su expediente\nY no tiene antecedente'', qué bien te ve''\nTu mirada no miente, llama si estás caliente\nY yo sigo aquí, tú siempre pasas por mi mente\nHablarte no me atreví, sé que conmigo no pueden verte\nSe dice por ahí que lo que no mata te hace má'' fuerte\nSi vuelvo a nacer, yo volvería a conocerte\nLa curiosidad me mata y no aguanto\nYa te quiero tener, solo dime cuándo\nEs que tú y yo muy bien sabemos\nQue es diferente cuando nos comemos (yeah)\nDaría lo que fuera por verte de nuevo (de nuevo)\nTranquila, nadie tiene que enterarse\nY no quiero envolverme, pero contigo me atrevo (me atrevo)\nHace tiempo tengo ganas de tocarte\nY es que tu arrebato me tiene loco\nY cuando veo tu foto me desenfoco\nDicen que es de loco'' lo de nosotro''\nY no saben lo que pasa cuando te toco (yeah)\nY quiero repetir\nEncima de mí quiero volverte a sentir\nContigo la pasé cabrón, no te voy a mentir\nLa curiosidad me mata y no aguanto\nYa te quiero tener, solo dime cuándo (oye)\nEs que tú y yo muy bien sabemo''\nQue es diferente cuando nos comemo'' (eh)\nYeah-yeah-yeah\nYeah-yeah\nLa Voz Favorita, baby\nJay Wheeler, Jay Wheeler\nMyke Towers\nDímelo, Siru\nJexciel, Jexciel\nLelo, Jazzy\nYeh\nFlow Music\nDynamic Records\nOh-oh, oh\nOh-oh, uh-oh\nYeah-yeah');
